import { render } from "@testing-library/react";
import { React, useState, useEffect } from "react";
import Card from "./Card";

const Necas = ({ titles }) => {
  const [newTitles, setNewTitles] = useState(titles);

  useEffect(() => {
    setNewTitles = titles;
  });

  return titles.Search.map((t) => {
    return <Card key={t.imdbID} title={t.Title} />;
  });
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
